const CCustomer =()=>{

    const [custInformation, setCustInformation] = useState({
        name: null,
        phoneNumber: null,
        email: null,
        dob: null,
        address: null,
        sex: null,
    })

    const handleSubmit=(e)=>{
        e.preventDefault()
        console.log(custInformation);
    }

    return(
        <div>
            <h1>This is Create Customer</h1>
            <form onSubmit={handleSubmit}>
                <label>
                    Name: 
                    <input type="text" placeholder='Name' onChange={(e)=>{setCustInformation({...custInformation, name:e.target.value})}} />
                </label>
                <input type="submit" value="Submit" />
            </form>
        </div>
    )
}

export default CCustomer;
